import React from 'react';
import ExampleComponent from './components/ExampleComponent';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Welcome to OmniPriceX</h1>
                <p>AI-powered dynamic pricing system</p>
            </header>
            <main>
                <ExampleComponent />
            </main>
        </div>
    );
}

export default App;
